    false,nt"url": null,nt"notes": "Grouse Creek valley is a trough-shaped
    depression that extends about 30 miles southwardnfrom T. 13 N. in the Grouse Creek
    and Goose Creek Mountains to the Great Salt Lake Desert innT. 7 N. The drainage
    basin extends a short distance into Nevada and includes about 430 squarenmiles.
    The known ground-water reservoir in the valley is in unconsolidated and consolidatednsedimentary
    rocks of Quaternary and Tertiary age and underlies at least 110 square miles.nThe
    source of water in Grouse Creek valley is precipitation on its drainage area, which
    isnestimated to average 276,000 acre-feet annually. All but about 1 percent of the
    precipitationnultimately is consumed within the drainage basin. Most runoff and
    ground-water recharge to thenvalley is derived from precipitation on lands above
    an altitude of about 6,000 feet. The estimatednaverage annual runoff from the uplands
    is 7,000 acre-feet. A very small part leaves the valley,nmainly as ephemeral flow
    after summer storms.",nt"license_title": null,nt"extras": [{ntt"key":
